export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "제로초",
      },
      content: "첫 번째 게시글 #해시태그 #익스프레스",
    },
  ],
};

const reducers = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducers;
